import React from 'react';
let formatter = Intl.NumberFormat('en-IN', {
    style: 'currency',
    currency: 'USD',
})
const TableTr = (props) => {
    console.log(props.savingsEndOfYear, 'i', props.intialSaving, 'j', props.yearlyContribution, 'k', props.year);
    return (
        <tr>
            <td>{props.year}</td>
            <td>{formatter.format(props.savingsEndOfYea)}</td>
            <td>{props.yearlyInterest}</td>
            <td>{(props.savingsEndOfYear - props.intialSaving) - (props.yearlyContribution * props.year)}</td>
            <td>{props.intialSaving + props.yearlyContribution * props.year}</td>
        </tr>
    )
}
export default TableTr;
